import React, {Component} from 'react'

class PlaceOrder extends Component {
    render() {
        return (
        <div class="ui segment">
        <h2 class="ui centered floated header">Thank You for Placing an Order with Hot Pizza's.</h2>
        <div class="ui clearing divider"></div>
        <p> Your order has been placed. Estimated delivery time is 20-35 mins. Thank You for visiting Hot Pizzas.</p>
        <p> Payment will be processed via credit card for $ amount paid </p>
        </div>
        )
    }
}

export default PlaceOrder
